import { YMaps, Map } from 'react-yandex-maps';

const App = () => (
<YMaps>
  <Map
    defaultState={{
      center: [55.751574, 37.573856],
      zoom: 9,
      controls: [],
    }}
  >
    <GeolocationControl options={{ float: 'left' }} />
  </Map>
</YMaps>
);
export default App;
